SELECT MEMB_FIRST_NAME, MEMB_LAST_NAME, MEMB_PHONE_NUMBER
FROM MEMBERSHIP_OWNER
WHERE MEMB_DATE_OF_BIRTH LIKE '%JUL%' OR MEMB_DATE_OF_BIRTH LIKE '%MAR%';

SELECT *
FROM VET
ORDER BY VET_LAST_NAME;

SELECT *
FROM TEAM
ORDER BY TEAM_NAME;

SELECT ASSOC_ID, ASSOC_NAME
FROM VET JOIN ASSOCIATION USING (ASSOC_ID)
WHERE VET_LAST_NAME = 'Booth';

SELECT VET_ID, VET_LAST_NAME, TEAM_NAME
FROM TEAM JOIN ASSOCIATION USING(ASSOC_ID) JOIN VET USING (ASSOC_ID)
WHERE VET_ID = 6495;

SELECT VET_ID, VET_FIRST_NAME, VET_LAST_NAME
FROM VET;

SELECT DON_FIRST_NAME, DON_LAST_NAME
FROM DONATOR
WHERE DON_DATE_DONATED > '31-JUL-09';

SELECT DISTINCT MAINT_TITLE
FROM MAINTENANCE;

SELECT SUM(QUANTITY)
FROM RECEIPT_LINE;

SELECT PRODUCT_NAME, PRODUCT_SUGGESTED_PRICE
FROM PRODUCT
WHERE PRODUCT_SUGGESTED_PRICE < 10
ORDER BY PRODUCT_NAME;

SELECT EMP_FIRST_NAME, EMP_LAST_NAME, EMP_ID
FROM EMPLOYEE
WHERE EMP_FIRST_NAME IN ('Mike', 'Tom', 'Sarah');

SELECT PRODUCT_NAME, PRODUCT_SUGGESTED_PRICE
FROM PRODUCT
WHERE PRODUCT_SUGGESTED_PRICE > (SELECT AVG(PRODUCT_SUGGESTED_PRICE) FROM PRODUCT);

SELECT TRANS_ID, SUM(SELLING_PRICE), SUM(QUANTITY)
FROM RECEIPT_LINE
GROUP BY TRANS_ID
ORDER BY TRANS_ID;


SELECT EMP_ID, SUM(TRANS_TOTAL_AMT)
FROM TRANSACTION
GROUP BY EMP_ID
HAVING SUM(TRANS_TOTAL_AMT) > 40;


SELECT ANIM_NAME, ANIM_BREED_NAME
FROM ANIMAL JOIN ANIMAL_BREED USING (ANIM_BREED_ID)
WHERE ANIM_BREED_HABITAT LIKE ('%Tropical%') OR ANIM_BREED_HABITAT LIKE ('%sub-tropical%');

SELECT PRODUCT_NAME, WAREHOUSE_ID
FROM PRODUCT JOIN INVENTORY USING (PRODUCT_ID) JOIN WAREHOUSE USING (WAREHOUSE_ID)
WHERE INVEN_REORDER_POINT >= 50;

SELECT FOOD_ITEM_DESCRIPTION, FOOD_PRICE, FOOD_SUP_COMPANY_NAME
FROM FOOD_CATEGORY JOIN FOOD_ITEM USING (FOOD_CATEGORY_ID) JOIN FOOD_ITEM_SUPPLIER USING (FOOD_ITEM_ID) JOIN FOOD_SUPPLIER USING (FOOD_SUP_ID)
WHERE FOOD_CATEGORY_DESCRIPTION LIKE ('California Condor%');

SELECT PRODUCT_NAME, PRODUCT_SUGGESTED_PRICE, SELLING_PRICE, INVEN_AMOUNT, EMP_FIRST_NAME, EMP_LAST_NAME
FROM INVENTORY JOIN PRODUCT USING (PRODUCT_ID) JOIN RECEIPT_LINE USING (PRODUCT_ID)
    JOIN TRANSACTION USING (TRANS_ID) JOIN EMPLOYEE USING (EMP_ID)
WHERE TRANS_TOTAL_AMT > 75 AND INVEN_AMOUNT > 100;

SELECT EMP_FIRST_NAME, EMP_LAST_NAME, DEPT_NAME
FROM EMPLOYEE FULL JOIN DEPARTMENT USING (DEPT_ID, ZOO_ID)
WHERE EMP_HIRE_DATE > '01-APR-08';

SELECT DISTINCT